import { CylinderRecord } from '../types';
import { REGISTRY } from '../constants';

export const matchSerialFromOCR = (ocrText: string): CylinderRecord => {
  // 1. Extract only digits
  const ocrDigits = ocrText.replace(/\D/g, '');

  if (!ocrDigits) {
    // Hard constraint: Must resolve to one. If no digits, return first (fallback)
    return REGISTRY[0];
  }

  // 2. Search for serial numbers that contain these digits in order
  const matches = REGISTRY.filter(record => {
    const recordDigits = record.serialNumber.replace(/\D/g, '');
    return recordDigits.includes(ocrDigits);
  });

  if (matches.length === 1) {
    return matches[0];
  }

  if (matches.length > 1) {
    // 3. Disambiguation Rule: Select most recently tested
    return matches.sort((a, b) => {
      const dateA = new Date(a.testDate).getTime();
      const dateB = new Date(b.testDate).getTime();
      return dateB - dateA;
    })[0];
  }

  // 4. No exact digit-sequence match? Find closest digit pattern similarity
  const findSimilarity = (s1: string, s2: string) => {
    const d1 = s1.replace(/\D/g, '');
    const d2 = s2.replace(/\D/g, '');
    let common = 0;
    for (let i = 0; i < Math.min(d1.length, d2.length); i++) {
      if (d1[i] === d2[i]) common++;
    }
    return common;
  };

  const sortedBySimilarity = [...REGISTRY].sort((a, b) => {
    return findSimilarity(ocrText, b.serialNumber) - findSimilarity(ocrText, a.serialNumber);
  });

  return sortedBySimilarity[0];
};

import { GoogleGenAI, Modality } from "@google/genai";

const ai = new GoogleGenAI({ apiKey: process.env.API_KEY || '' });

export const performOCR = async (imageBase64: string): Promise<string> => {
  try {
    const response = await ai.models.generateContent({
      model: 'gemini-3-flash-preview',
      contents: [
        {
          parts: [
            { inlineData: { mimeType: 'image/jpeg', data: imageBase64 } },
            { text: "Extract the cylinder serial number from this image. Only return the serial number string, nothing else. Focus on alphanumeric patterns like '354434.S' or '593286.J'." }
          ]
        }
      ]
    });
    return response.text?.trim() || '';
  } catch (error) {
    console.error("OCR Error:", error);
    return "";
  }
};

export const generateVoiceSummary = async (
  text: string, 
  languageName: string, 
  onAudioReady: (audioBuffer: AudioBuffer) => void
) => {
  const prompt = `Translate and read the following technical industrial cylinder inspection data naturally in ${languageName}. Ensure serial numbers and IDs are pronounced digit by digit clearly. Data: ${text}`;

  try {
    const response = await ai.models.generateContent({
      model: "gemini-2.5-flash-preview-tts",
      contents: [{ parts: [{ text: prompt }] }],
      config: {
        responseModalities: [Modality.AUDIO],
        speechConfig: {
          voiceConfig: {
            prebuiltVoiceConfig: { voiceName: 'Kore' },
          },
        },
      },
    });

    const base64Audio = response.candidates?.[0]?.content?.parts?.[0]?.inlineData?.data;
    if (base64Audio) {
      const audioContext = new (window.AudioContext || (window as any).webkitAudioContext)({ sampleRate: 24000 });
      const audioData = decode(base64Audio);
      const buffer = await decodeAudioData(audioData, audioContext, 24000, 1);
      onAudioReady(buffer);
    }
  } catch (error) {
    console.error("Voice Summary Error:", error);
  }
};

// Audio Utilities
function decode(base64: string) {
  const binaryString = atob(base64);
  const len = binaryString.length;
  const bytes = new Uint8Array(len);
  for (let i = 0; i < len; i++) {
    bytes[i] = binaryString.charCodeAt(i);
  }
  return bytes;
}

async function decodeAudioData(
  data: Uint8Array,
  ctx: AudioContext,
  sampleRate: number,
  numChannels: number,
): Promise<AudioBuffer> {
  const dataInt16 = new Int16Array(data.buffer);
  const frameCount = dataInt16.length / numChannels;
  const buffer = ctx.createBuffer(numChannels, frameCount, sampleRate);

  for (let channel = 0; channel < numChannels; channel++) {
    const channelData = buffer.getChannelData(channel);
    for (let i = 0; i < frameCount; i++) {
      channelData[i] = dataInt16[i * numChannels + channel] / 32768.0;
    }
  }
  return buffer;
}

