import React, { useState, useRef, useEffect } from 'react';
import { Camera, Upload, Volume2, Plus, RefreshCcw, Box, Activity, Calendar, Eye } from 'lucide-react';
import { CylinderRecord, LANGUAGES } from '../types';
import { performOCR, generateVoiceSummary } from '../services/geminiService';
import { matchSerialFromOCR } from '../services/dataService';

interface ScannerProps {
  onCommit: (record: CylinderRecord) => void;
  onNewScan: () => void;
}

const Scanner: React.FC<ScannerProps> = ({ onCommit, onNewScan }) => {
  const [isScanning, setIsScanning] = useState(false);
  const [isLoading, setIsLoading] = useState(false);
  const [result, setResult] = useState<CylinderRecord | null>(null);
  const [selectedLang, setSelectedLang] = useState('en');
  const [isSpeaking, setIsSpeaking] = useState(false);

  const videoRef = useRef<HTMLVideoElement>(null);
  const canvasRef = useRef<HTMLCanvasElement>(null);
  const audioSourceRef = useRef<AudioBufferSourceNode | null>(null);

  const startCamera = async () => {
    try {
      setIsScanning(true);
      const stream = await navigator.mediaDevices.getUserMedia({ video: { facingMode: 'environment' } });
      if (videoRef.current) {
        videoRef.current.srcObject = stream;
      }
    } catch (err) {
      console.error("Camera error:", err);
      setIsScanning(false);
    }
  };

  const captureAndOCR = async () => {
    if (!videoRef.current || !canvasRef.current) return;

    setIsLoading(true);
    const context = canvasRef.current.getContext('2d');
    canvasRef.current.width = videoRef.current.videoWidth;
    canvasRef.current.height = videoRef.current.videoHeight;
    context?.drawImage(videoRef.current, 0, 0);

    const base64 = canvasRef.current.toDataURL('image/jpeg').split(',')[1];

    // Stop camera
    const stream = videoRef.current.srcObject as MediaStream;
    stream.getTracks().forEach(t => t.stop());
    setIsScanning(false);

    const ocrResult = await performOCR(base64);
    const matchedRecord = matchSerialFromOCR(ocrResult);

    setResult(matchedRecord);
    setIsLoading(false);
  };

  const handleFileUpload = async (e: React.ChangeEvent<HTMLInputElement>) => {
    const file = e.target.files?.[0];
    if (!file) return;

    setIsLoading(true);
    const reader = new FileReader();
    reader.onload = async (event) => {
      const base64 = (event.target?.result as string).split(',')[1];
      const ocrResult = await performOCR(base64);
      const matchedRecord = matchSerialFromOCR(ocrResult);
      setResult(matchedRecord);
      setIsLoading(false);
    };
    reader.readAsDataURL(file);
  };

  const handleVoiceSummary = async () => {
    if (!result) return;
    setIsSpeaking(true);

    const langObj = LANGUAGES.find(l => l.code === selectedLang);
    const textToRead = `
      Cylinder ID: ${result.cylinderId}.
      Serial Number: ${result.serialNumber}.
      Manufacturer: ${result.manufacturer}.
      Capacity: ${result.capacity}.
      Working Pressure: ${result.workingPressure}.
      Test Date: ${result.testDate}.
      Hazard: ${result.hazardType}.
      Rust Level: ${result.rustLevel}.
      Remarks: ${result.remarks}.
    `;

    await generateVoiceSummary(textToRead, langObj?.name || 'English', (buffer) => {
      const ctx = new (window.AudioContext || (window as any).webkitAudioContext)();
      const source = ctx.createBufferSource();
      source.buffer = buffer;
      source.connect(ctx.destination);
      source.onended = () => setIsSpeaking(false);
      source.start(0);
      audioSourceRef.current = source;
    });
  };

  useEffect(() => {
    if (result && selectedLang !== 'en') {
      handleVoiceSummary();
    }
  }, [selectedLang]);

  if (isLoading) {
    return (
      <div className="flex flex-col items-center justify-center h-[70vh] space-y-4 animate-pulse">
        <RefreshCcw className="w-12 h-12 text-[#2dd4bf] animate-spin" />
        <p className="text-xl font-medium">Analyzing Cylinder...</p>
        <p className="text-slate-500 text-sm">Precision registry matching in progress</p>
      </div>
    );
  }

  if (result) {
    return (
      <div className="p-8 max-w-5xl mx-auto space-y-6 animate-in slide-in-from-bottom duration-500">
        <div className="flex justify-between items-center mb-4">
          <div className="space-y-1">
            <h1 className="text-4xl font-bold">{result.serialNumber}</h1>
            <div className="flex gap-2">
              <span className="bg-emerald-500/20 text-emerald-400 text-[10px] font-bold px-2 py-1 rounded-md uppercase border border-emerald-500/30">MATCHED: FIT FOR USE</span>
              <span className="bg-blue-500/20 text-blue-400 text-[10px] font-bold px-2 py-1 rounded-md uppercase border border-blue-500/30">{result.gasType}</span>
            </div>
          </div>
          <div className="flex flex-col items-end">
             <select 
              value={selectedLang}
              onChange={(e) => setSelectedLang(e.target.value)}
              className="bg-black border border-slate-700 text-white px-4 py-2 rounded-lg text-xs focus:outline-none focus:border-[#2dd4bf]"
             >
               {LANGUAGES.map(l => (
                 <option key={l.code} value={l.code}>{l.name.toUpperCase()}</option>
               ))}
             </select>
          </div>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          {/* Section 1 */}
          <div className="bg-[#1e293b] rounded-2xl p-6 border border-slate-800">
            <div className="flex items-center gap-2 mb-4 text-indigo-400">
              <Box size={18} />
              <h3 className="text-xs font-bold tracking-widest uppercase">Unit Identification</h3>
            </div>
            <div className="space-y-3">
              {[
                ['Cylinder ID', result.cylinderId],
                ['Manufacturer', result.manufacturer],
                ['Location', result.locationType],
                ['Type', result.gasType]
              ].map(([k, v]) => (
                <div key={k} className="flex justify-between py-1 border-b border-slate-800/50">
                  <span className="text-slate-500 text-xs">{k}</span>
                  <span className="text-white text-xs font-medium">{v}</span>
                </div>
              ))}
            </div>
          </div>

          {/* Section 2 */}
          <div className="bg-[#1e293b] rounded-2xl p-6 border border-slate-800">
            <div className="flex items-center gap-2 mb-4 text-indigo-400">
              <Activity size={18} />
              <h3 className="text-xs font-bold tracking-widest uppercase">Technical Specs</h3>
            </div>
            <div className="space-y-3">
              {[
                ['Capacity', result.capacity],
                ['Working Pressure', result.workingPressure],
                ['Test Pressure', result.testPressure],
                ['Standard Code', result.standardCode]
              ].map(([k, v]) => (
                <div key={k} className="flex justify-between py-1 border-b border-slate-800/50">
                  <span className="text-slate-500 text-xs">{k}</span>
                  <span className="text-white text-xs font-medium">{v}</span>
                </div>
              ))}
            </div>
          </div>

          {/* Section 3 */}
          <div className="bg-[#1e293b] rounded-2xl p-6 border border-slate-800">
            <div className="flex items-center gap-2 mb-4 text-indigo-400">
              <Calendar size={18} />
              <h3 className="text-xs font-bold tracking-widest uppercase">Maintenance Logs</h3>
            </div>
            <div className="space-y-3">
              {[
                ['Test Date', result.testDate],
                ['Expiry Date', result.expiryDate],
                ['Inspection Date', result.inspectionDate]
              ].map(([k, v]) => (
                <div key={k} className="flex justify-between py-1 border-b border-slate-800/50">
                  <span className="text-slate-500 text-xs">{k}</span>
                  <span className="text-white text-xs font-medium">{v}</span>
                </div>
              ))}
            </div>
          </div>

          {/* Section 4 */}
          <div className="bg-[#1e293b] rounded-2xl p-6 border border-slate-800">
            <div className="flex items-center gap-2 mb-4 text-indigo-400">
              <Eye size={18} />
              <h3 className="text-xs font-bold tracking-widest uppercase">Visual Inspection</h3>
            </div>
            <div className="space-y-3">
              {[
                ['Hazard Type', result.hazardType],
                ['Rust Level', result.rustLevel],
                ['Cap Present', result.capPresent],
                ['Label Condition', result.labelCondition]
              ].map(([k, v]) => (
                <div key={k} className="flex justify-between py-1 border-b border-slate-800/50">
                  <span className="text-slate-500 text-xs">{k}</span>
                  <span className="text-white text-xs font-medium">{v}</span>
                </div>
              ))}
            </div>
          </div>
        </div>

        <div className="flex flex-wrap items-center gap-4 pt-4 border-t border-slate-800">
          <button
            onClick={handleVoiceSummary}
            disabled={isSpeaking}
            className="flex items-center gap-2 px-6 py-3 rounded-xl bg-indigo-600/20 text-indigo-400 border border-indigo-500/30 hover:bg-indigo-600/30 transition-all font-bold text-sm"
          >
            <Volume2 size={18} className={isSpeaking ? "animate-pulse" : ""} />
            Voice Summary
          </button>

          <button
            onClick={() => onCommit(result)}
            className="flex-1 bg-[#2dd4bf] hover:bg-[#14b8a6] text-[#020617] px-8 py-3 rounded-xl font-bold transition-all flex items-center justify-center gap-2 shadow-lg shadow-[#2dd4bf]/20"
          >
            <Plus size={20} />
            Commit to Inventory Registry
          </button>

          <button
            onClick={() => {
              setResult(null);
              onNewScan();
            }}
            className="px-6 py-3 text-slate-400 hover:text-white transition-all font-bold text-sm"
          >
            NEW SCAN
          </button>
        </div>
      </div>
    );
  }

  return (
    <div className="p-8 max-w-4xl mx-auto space-y-6 animate-in fade-in duration-500">
      <div className="flex justify-between items-center mb-4">
        <h2 className="text-2xl font-bold flex items-center gap-3">
          <div className="w-8 h-8 rounded bg-[#2dd4bf]/10 flex items-center justify-center">
            <ScanLine className="text-[#2dd4bf] w-5 h-5" />
          </div>
          Industrial AI Vision
        </h2>
        <div className="flex items-center gap-3">
           <select 
            value={selectedLang}
            onChange={(e) => setSelectedLang(e.target.value)}
            className="bg-black border border-slate-700 text-white px-4 py-2 rounded-lg text-xs focus:outline-none focus:border-[#2dd4bf]"
           >
             {LANGUAGES.map(l => (
               <option key={l.code} value={l.code}>{l.name.toUpperCase()}</option>
             ))}
           </select>
        </div>
      </div>

      <div className="bg-[#1e293b] border-2 border-dashed border-slate-700 rounded-[2rem] h-[50vh] flex flex-col items-center justify-center text-center p-10 relative overflow-hidden group">
        {isScanning ? (
          <div className="absolute inset-0 z-10 flex flex-col">
            <video ref={videoRef} autoPlay playsInline className="w-full h-full object-cover rounded-[1.8rem]" />
            <div className="absolute inset-0 flex items-center justify-center pointer-events-none">
              <div className="w-64 h-24 border-2 border-[#2dd4bf] rounded-lg shadow-[0_0_50px_rgba(45,212,191,0.5)] animate-pulse" />
            </div>
            <div className="absolute bottom-10 left-0 right-0 flex justify-center px-10">
              <button 
                onClick={captureAndOCR}
                className="bg-[#2dd4bf] text-[#020617] w-full py-4 rounded-xl font-bold hover:scale-105 transition-all shadow-xl"
              >
                Capture Cylinder Markings
              </button>
            </div>
          </div>
        ) : (
          <>
            <div className="w-20 h-20 bg-slate-800 rounded-full flex items-center justify-center mb-6 group-hover:scale-110 transition-all duration-500">
              <Camera size={32} className="text-[#2dd4bf]" />
            </div>
            <button 
              onClick={startCamera}
              className="text-white text-2xl font-bold mb-2 hover:text-[#2dd4bf] transition-colors"
            >
              Open Live Scanner
            </button>
            <p className="text-slate-500 text-sm mb-8">IDENTIFY RUSTED MARKING VIA CAMERA</p>
          </>
        )}
      </div>

      <div className="flex flex-col items-center">
        <label className="flex items-center gap-2 cursor-pointer text-slate-400 hover:text-[#2dd4bf] transition-colors font-medium">
          <Upload size={18} />
          <span>Upload Photo for OCR</span>
          <input type="file" className="hidden" accept="image/*" onChange={handleFileUpload} />
        </label>
      </div>

