      </div>

      <div className="grid grid-cols-1 md:grid-cols-2 gap-6 items-stretch">
        {/* Container for Live Scanner */}
        <div className="bg-[#1e293b] border-2 border-dashed border-slate-700 rounded-[2rem] h-[35vh] min-h-[280px] flex flex-col items-center justify-center text-center p-6 relative overflow-hidden group shadow-2xl transition-all">
