import React, { useState } from 'react';
import Sidebar from './components/Sidebar';
import Dashboard from './components/Dashboard';
import Scanner from './components/Scanner';
import Registry from './components/Registry';
import { Page, AppState, CylinderRecord } from './types';
import { Menu, X } from 'lucide-react';

const App: React.FC = () => {
  const [activePage, setActivePage] = useState<Page>(Page.Dashboard);
  const [isSidebarOpen, setIsSidebarOpen] = useState(false);
  const [state, setState] = useState<AppState>({
    scannedCount: 0,
    fitForUseCount: 0,
    hazardDetectedCount: 0,
    registryEntries: [],
    currentScan: null,
    history: []
  });

  const handleCommitRecord = (record: CylinderRecord) => {
    setState(prev => ({
      ...prev,
      registryEntries: [...prev.registryEntries, record],
      scannedCount: prev.scannedCount + 1,
      fitForUseCount: record.remarks.toLowerCase().includes('fit') ? prev.fitForUseCount + 1 : prev.fitForUseCount,
      hazardDetectedCount: record.hazardType.toLowerCase().includes('highly') ? prev.hazardDetectedCount + 1 : prev.hazardDetectedCount
    }));
    setActivePage(Page.InventoryRegistry);
  };

  const handleNewScan = () => {
    setActivePage(Page.VisionScanner);
  };

  const toggleSidebar = () => setIsSidebarOpen(!isSidebarOpen);

  return (
    <div className="min-h-screen flex bg-[#020617] text-slate-200 overflow-x-hidden">
      {/* Sidebar Overlay for Mobile */}
      {isSidebarOpen && (
        <div 
          className="fixed inset-0 bg-black/60 backdrop-blur-sm z-40 lg:hidden"
          onClick={toggleSidebar}
        />
      )}

      <div className={`fixed inset-y-0 left-0 z-50 transform ${isSidebarOpen ? 'translate-x-0' : '-translate-x-full'} lg:translate-x-0 transition-transform duration-300 ease-in-out`}>
        <Sidebar 
          activePage={activePage} 
          setActivePage={(page) => {
            setActivePage(page);
            setIsSidebarOpen(false);
          }} 
        />
      </div>

      <main className={`flex-1 transition-all duration-300 ${isSidebarOpen ? 'lg:ml-64' : 'lg:ml-64'} min-h-screen w-full`}>
        <header className="h-16 border-b border-slate-800/50 flex items-center px-4 lg:px-8 justify-between sticky top-0 bg-[#020617]/80 backdrop-blur-md z-30">
          <div className="flex items-center gap-3">
            <button 
              onClick={toggleSidebar}
              className="lg:hidden p-2 hover:bg-slate-800 rounded-lg text-slate-400"
            >
              {isSidebarOpen ? <X size={24} /> : <Menu size={24} />}
            </button>
          </div>
          <div className="flex items-center gap-4">
             {/* AV icon removed */}
          </div>
        </header>

        <div className="relative pt-4 pb-12 w-full">
          {activePage === Page.Dashboard && (
            <Dashboard 
              state={state} 
              onStartScanner={() => setActivePage(Page.VisionScanner)} 
            />
          )}
          {activePage === Page.VisionScanner && (
            <Scanner 
              onCommit={handleCommitRecord}
              onNewScan={handleNewScan}
            />
          )}
          {activePage === Page.InventoryRegistry && (
            <Registry data={state.registryEntries} />
          )}
        </div>
      </main>
    </div>
  );
};

export default App;

import React, { useState, useRef, useEffect } from 'react';
import { Camera, Upload, Volume2, Plus, RefreshCcw, Box, Activity, Calendar, Eye } from 'lucide-react';
import { CylinderRecord, LANGUAGES } from '../types';
import { performOCR, generateVoiceSummary } from '../services/geminiService';
import { matchSerialFromOCR } from '../services/dataService';

interface ScannerProps {
  onCommit: (record: CylinderRecord) => void;
  onNewScan: () => void;
}

const Scanner: React.FC<ScannerProps> = ({ onCommit, onNewScan }) => {
  const [isScanning, setIsScanning] = useState(false);
  const [isLoading, setIsLoading] = useState(false);
  const [result, setResult] = useState<CylinderRecord | null>(null);
  const [selectedLang, setSelectedLang] = useState('en');
  const [isSpeaking, setIsSpeaking] = useState(false);

  const videoRef = useRef<HTMLVideoElement>(null);
  const canvasRef = useRef<HTMLCanvasElement>(null);
  const audioSourceRef = useRef<AudioBufferSourceNode | null>(null);

  const startCamera = async () => {
    try {
      setIsScanning(true);
      const stream = await navigator.mediaDevices.getUserMedia({ video: { facingMode: 'environment' } });
      if (videoRef.current) {
        videoRef.current.srcObject = stream;
      }
    } catch (err) {
      console.error("Camera error:", err);
      setIsScanning(false);
    }
  };

  const captureAndOCR = async () => {
    if (!videoRef.current || !canvasRef.current) return;

    setIsLoading(true);
    const context = canvasRef.current.getContext('2d');
    canvasRef.current.width = videoRef.current.videoWidth;
    canvasRef.current.height = videoRef.current.videoHeight;
    context?.drawImage(videoRef.current, 0, 0);

    const base64 = canvasRef.current.toDataURL('image/jpeg').split(',')[1];

    // Stop camera
    const stream = videoRef.current.srcObject as MediaStream;
    stream.getTracks().forEach(t => t.stop());
    setIsScanning(false);

    const ocrResult = await performOCR(base64);
    const matchedRecord = matchSerialFromOCR(ocrResult);

    setResult(matchedRecord);
    setIsLoading(false);
  };

  const handleFileUpload = async (e: React.ChangeEvent<HTMLInputElement>) => {
    const file = e.target.files?.[0];
    if (!file) return;

    setIsLoading(true);
    const reader = new FileReader();
    reader.onload = async (event) => {
      const base64 = (event.target?.result as string).split(',')[1];
      const ocrResult = await performOCR(base64);
      const matchedRecord = matchSerialFromOCR(ocrResult);
      setResult(matchedRecord);
      setIsLoading(false);
    };
    reader.readAsDataURL(file);
  };

  const handleVoiceSummary = async () => {
    if (!result) return;

    // Stop existing audio if playing
    if (audioSourceRef.current) {
      try { audioSourceRef.current.stop(); } catch (e) {}
    }

    setIsSpeaking(true);
    const langObj = LANGUAGES.find(l => l.code === selectedLang);
    const textToRead = `
      Cylinder ID: ${result.cylinderId}.
      Serial Number: ${result.serialNumber}.
      Manufacturer: ${result.manufacturer}.
      Capacity: ${result.capacity}.
      Working Pressure: ${result.workingPressure}.
      Test Date: ${result.testDate}.
      Hazard: ${result.hazardType}.
      Rust Level: ${result.rustLevel}.
      Remarks: ${result.remarks}.
    `;

    await generateVoiceSummary(textToRead, langObj?.name || 'English', (buffer) => {
      const ctx = new (window.AudioContext || (window as any).webkitAudioContext)();
      const source = ctx.createBufferSource();
      source.buffer = buffer;
      source.connect(ctx.destination);
      source.onended = () => setIsSpeaking(false);
      source.start(0);
      audioSourceRef.current = source;
    });
  };

  useEffect(() => {
    if (result && selectedLang !== 'en') {
      handleVoiceSummary();
    }
  }, [selectedLang]);

  if (isLoading) {
