                ['Rust Level', result.rustLevel],
                ['Cap Present', result.capPresent],
                ['Label Condition', result.labelCondition]
              ].map(([k, v]) => (
                <div key={k} className="flex justify-between items-center py-1 border-b border-slate-800/50 last:border-0">
                  <span className="text-slate-500 text-xs">{k}</span>
                  <span className="text-white text-xs font-medium text-right ml-2">{v}</span>
                </div>
              ))}
            </div>
          </div>
        </div>

        <div className="flex flex-col sm:flex-row items-stretch sm:items-center gap-4 pt-6 border-t border-slate-800">
          <button
            onClick={handleVoiceSummary}
            disabled={isSpeaking}
            className="flex items-center justify-center gap-2 px-6 py-4 rounded-xl bg-indigo-600/20 text-indigo-400 border border-indigo-500/30 hover:bg-indigo-600/30 transition-all font-bold text-sm"
          >
            <Volume2 size={18} className={isSpeaking ? "animate-pulse" : ""} />
            Voice Summary
          </button>

          <button
            onClick={() => onCommit(result)}
            className="flex-1 bg-[#2dd4bf] hover:bg-[#14b8a6] text-[#020617] px-8 py-4 rounded-xl font-bold transition-all flex items-center justify-center gap-2 shadow-lg shadow-[#2dd4bf]/20"
          >
            <Plus size={20} />
            Commit to Inventory Registry
          </button>

          <button
            onClick={() => {
              setResult(null);
              onNewScan();
            }}
            className="px-6 py-4 text-slate-400 hover:text-white transition-all font-bold text-sm uppercase tracking-widest"
          >
            NEW SCAN
          </button>
        </div>
      </div>
    );
  }

  return (
    <div className="p-4 lg:p-8 max-w-5xl mx-auto space-y-6 animate-in fade-in duration-500">
