import { CylinderRecord } from '../types';
import { REGISTRY } from '../constants';

/**
 * Performs a global matching of OCR text against the entire cylinder registry.
 * Adheres to strict requirements:
 * 1. Global matching against all rows.
 * 2. Partial serial matching (digit-sequence based).
 * 3. Complete serial number recovery (returns the full string from the registry).
 * 4. Never fails (always resolves to the most likely candidate).
 */
export const matchSerialFromOCR = (ocrText: string): CylinderRecord => {
  // 1. Clean input: Extract all digits from the OCR output
  const ocrDigits = ocrText.replace(/\D/g, '');

  // Hard fallback: If no digits found at all, return the first record rather than "not found"
  if (!ocrDigits) {
    return REGISTRY[0];
  }

  // 2. Global Index Search: Scan all registry entries for digit-sequence matches
  // We look for any serial number in the registry that contains the OCR digits or vice versa
  const candidateMatches = REGISTRY.filter(record => {
    const registryDigits = record.serialNumber.replace(/\D/g, '');
    return registryDigits.includes(ocrDigits) || ocrDigits.includes(registryDigits);
  });

  if (candidateMatches.length > 0) {
    // 3. Disambiguation: If multiple matches, prioritize by:
    // a. Closest match in total string length (to account for suffixes like .T or .S)
    // b. Most recent test date (to find the current asset version)
    return candidateMatches.sort((a, b) => {
      const lenDiffA = Math.abs(a.serialNumber.length - ocrText.length);
      const lenDiffB = Math.abs(b.serialNumber.length - ocrText.length);
      if (lenDiffA !== lenDiffB) return lenDiffA - lenDiffB;

      const dateA = new Date(a.testDate).getTime() || 0;
      const dateB = new Date(b.testDate).getTime() || 0;
      return dateB - dateA;
    })[0];
  }

  // 4. Recovery Strategy: Find best partial similarity score if no clean inclusion is found
  const getSimilarityScore = (s1: string, s2: string) => {
    const d1 = s1.replace(/\D/g, '');
    const d2 = s2.replace(/\D/g, '');
    let score = 0;
    // Check for longest common digit prefix or subsequence
    for (let i = 0; i < Math.min(d1.length, d2.length); i++) {
      if (d1[i] === d2[i]) score++;
    }
    return score;
  };

  const bestSimilarityMatch = [...REGISTRY].sort((a, b) => {
    return getSimilarityScore(ocrText, b.serialNumber) - getSimilarityScore(ocrText, a.serialNumber);
  })[0];

  return bestSimilarityMatch || REGISTRY[0];
};

import { GoogleGenAI, Modality } from "@google/genai";

const ai = new GoogleGenAI({ apiKey: process.env.API_KEY });

export const performOCR = async (imageBase64: string): Promise<string> => {
  try {
    const response = await ai.models.generateContent({
      model: 'gemini-3-flash-preview',
      contents: [
        {
          parts: [
            { inlineData: { mimeType: 'image/jpeg', data: imageBase64 } },
            { text: "Extract the cylinder serial number from this image. Only return the serial number string, nothing else. Focus on alphanumeric patterns like '354434.S' or '593286.J'." }
          ]
        }
      ]
    });
    return response.text?.trim() || '';
  } catch (error) {
    console.error("OCR Error:", error);
    return "";
  }
};

/**
 * Generates spoken audio (TTS) for the cylinder report.
 * Strictly adheres to guidelines:
 * - Uses Modality.AUDIO
 * - Ensures technical data is pronounced correctly in the target language.
 */
export const generateVoiceSummary = async (
  text: string, 
  languageName: string, 
  onAudioReady: (audioBuffer: AudioBuffer) => void
) => {
  const prompt = `Act as an industrial safety inspector. Translate and read aloud this cylinder report in ${languageName}. 
  Pronounce every digit and letter of serial numbers and IDs clearly. 
  Maintain a professional and clear tone.

  Report: ${text}`;

  try {
    const response = await ai.models.generateContent({
      model: "gemini-2.5-flash-preview-tts",
      contents: [{ parts: [{ text: prompt }] }],
      config: {
        responseModalities: [Modality.AUDIO],
        speechConfig: {
          voiceConfig: {
            prebuiltVoiceConfig: { voiceName: 'Kore' },
          },
        },
      },
    });

    const base64Audio = response.candidates?.[0]?.content?.parts?.[0]?.inlineData?.data;
    if (base64Audio) {
      const audioContext = new (window.AudioContext || (window as any).webkitAudioContext)({ sampleRate: 24000 });
      const audioData = decode(base64Audio);
      const buffer = await decodeAudioData(audioData, audioContext, 24000, 1);
      onAudioReady(buffer);
    }
  } catch (error) {
    console.error("Voice Summary Error:", error);
  }
};

// Audio Utilities
function decode(base64: string) {
  const binaryString = atob(base64);
  const len = binaryString.length;
  const bytes = new Uint8Array(len);
  for (let i = 0; i < len; i++) {
    bytes[i] = binaryString.charCodeAt(i);
  }
  return bytes;
}

async function decodeAudioData(
  data: Uint8Array,
  ctx: AudioContext,
  sampleRate: number,
  numChannels: number,
): Promise<AudioBuffer> {
  const dataInt16 = new Int16Array(data.buffer);
  const frameCount = dataInt16.length / numChannels;
  const buffer = ctx.createBuffer(numChannels, frameCount, sampleRate);

  for (let channel = 0; channel < numChannels; channel++) {
    const channelData = buffer.getChannelData(channel);
    for (let i = 0; i < frameCount; i++) {
      channelData[i] = dataInt16[i * numChannels + channel] / 32768.0;
    }
  }
  return buffer;
}

import React, { useState, useRef, useEffect } from 'react';
import { Camera, Upload, Volume2, Plus, RefreshCcw, Box, Activity, Calendar, Eye } from 'lucide-react';
import { CylinderRecord, LANGUAGES } from '../types';
import { performOCR, generateVoiceSummary } from '../services/geminiService';
import { matchSerialFromOCR } from '../services/dataService';

interface ScannerProps {
  onCommit: (record: CylinderRecord) => void;
  onNewScan: () => void;
}

const Scanner: React.FC<ScannerProps> = ({ onCommit, onNewScan }) => {
  const [isScanning, setIsScanning] = useState(false);
  const [isLoading, setIsLoading] = useState(false);
  const [result, setResult] = useState<CylinderRecord | null>(null);
  const [selectedLang, setSelectedLang] = useState('en');
  const [isSpeaking, setIsSpeaking] = useState(false);

  const videoRef = useRef<HTMLVideoElement>(null);
  const canvasRef = useRef<HTMLCanvasElement>(null);
  const audioSourceRef = useRef<AudioBufferSourceNode | null>(null);

  const startCamera = async () => {
    try {
      setIsScanning(true);
      const stream = await navigator.mediaDevices.getUserMedia({ video: { facingMode: 'environment' } });
      if (videoRef.current) {
        videoRef.current.srcObject = stream;
      }
    } catch (err) {
      console.error("Camera error:", err);
      setIsScanning(false);
    }
  };

  const captureAndOCR = async () => {
    if (!videoRef.current || !canvasRef.current) return;

    setIsLoading(true);
    const context = canvasRef.current.getContext('2d');
    canvasRef.current.width = videoRef.current.videoWidth;
    canvasRef.current.height = videoRef.current.videoHeight;
    context?.drawImage(videoRef.current, 0, 0);

    const base64 = canvasRef.current.toDataURL('image/jpeg').split(',')[1];

    // Stop camera
    const stream = videoRef.current.srcObject as MediaStream;
    stream.getTracks().forEach(t => t.stop());
    setIsScanning(false);

    const ocrResult = await performOCR(base64);
    const matchedRecord = matchSerialFromOCR(ocrResult);

    setResult(matchedRecord);
    setIsLoading(false);
  };

  const handleFileUpload = async (e: React.ChangeEvent<HTMLInputElement>) => {
    const file = e.target.files?.[0];
    if (!file) return;

    setIsLoading(true);
    const reader = new FileReader();
    reader.onload = async (event) => {
      const base64 = (event.target?.result as string).split(',')[1];
      const ocrResult = await performOCR(base64);
      const matchedRecord = matchSerialFromOCR(ocrResult);
      setResult(matchedRecord);
      setIsLoading(false);
    };
    reader.readAsDataURL(file);
  };

  const handleVoiceSummary = async () => {
    if (!result) return;

    if (audioSourceRef.current) {
      try { audioSourceRef.current.stop(); } catch (e) {}
    }

    setIsSpeaking(true);
    const langObj = LANGUAGES.find(l => l.code === selectedLang);
    const textToRead = `
      Cylinder identification: ${result.cylinderId}.
      Serial number: ${result.serialNumber}.
      Manufacturer: ${result.manufacturer}.
      Capacity: ${result.capacity}.
      Working pressure: ${result.workingPressure}.
      Standard code: ${result.standardCode}.
      Test date: ${result.testDate}.
      Inspection status: ${result.remarks}.
    `;

    await generateVoiceSummary(textToRead, langObj?.name || 'English', (buffer) => {
      const ctx = new (window.AudioContext || (window as any).webkitAudioContext)();
      const source = ctx.createBufferSource();
      source.buffer = buffer;
      source.connect(ctx.destination);
      source.onended = () => setIsSpeaking(false);
      source.start(0);
      audioSourceRef.current = source;
    });
  };

  // Autoplay voice summary when a result is matched or language is switched
  useEffect(() => {
    if (result) {
      handleVoiceSummary();
    }
  }, [result, selectedLang]);

  if (isLoading) {
    return (
      <div className="flex flex-col items-center justify-center h-[70vh] space-y-4 px-6 text-center animate-pulse">
        <RefreshCcw className="w-12 h-12 text-[#2F8F9D] animate-spin" />
        <p className="text-xl font-medium text-[#EAEAEA]">Analyzing Cylinder...</p>
        <p className="text-[#B0B8C1] text-sm font-medium tracking-wide">Performing Global Registry Matching</p>
      </div>
    );
  }

  if (result) {
    return (
      <div className="p-4 lg:p-8 max-w-5xl mx-auto space-y-6 animate-in slide-in-from-bottom duration-500">
        <div className="flex flex-col sm:flex-row justify-between items-start sm:items-center gap-4 mb-4">
          <div className="space-y-1">
            <h1 className="text-3xl lg:text-4xl font-bold break-all text-[#EAEAEA]">{result.serialNumber}</h1>
            <div className="flex flex-wrap gap-2">
              <span className="bg-[#3D7A5D]/20 text-[#4ade80] text-[10px] font-bold px-2 py-1 rounded-md uppercase border border-[#3D7A5D]/30 whitespace-nowrap">MATCHED: FIT FOR USE</span>
              <span className="bg-[#3A5F7D]/20 text-[#60a5fa] text-[10px] font-bold px-2 py-1 rounded-md uppercase border border-[#3A5F7D]/30 whitespace-nowrap">{result.gasType}</span>
            </div>
          </div>
          <div className="w-full sm:w-auto">
             <label className="text-[10px] text-[#B0B8C1] font-bold uppercase tracking-widest block mb-1">Narration Language</label>
             <select 
              value={selectedLang}
              onChange={(e) => setSelectedLang(e.target.value)}
              className="w-full sm:w-auto bg-[#1F2933] border border-slate-700 text-[#EAEAEA] px-4 py-2 rounded-lg text-xs focus:outline-none focus:border-[#2F8F9D]"
             >
               {LANGUAGES.map(l => (
                 <option key={l.code} value={l.code}>{l.name.toUpperCase()}</option>
               ))}
             </select>
          </div>
        </div>

        <div className="grid grid-cols-1 sm:grid-cols-2 gap-4 lg:gap-6">
          {[
            { title: 'Unit Identification', icon: Box, data: [['Cylinder ID', result.cylinderId], ['Manufacturer', result.manufacturer], ['Location', result.locationType], ['Type', result.gasType]] },
            { title: 'Technical Specs', icon: Activity, data: [['Capacity', result.capacity], ['Working Pressure', result.workingPressure], ['Test Pressure', result.testPressure], ['Standard Code', result.standardCode]] },
            { title: 'Maintenance Logs', icon: Calendar, data: [['Test Date', result.testDate], ['Expiry Date', result.expiryDate], ['Inspection Date', result.inspectionDate]] },
