                    <span className="text-[#B0B8C1] text-xs font-medium">{k}</span>
                    <span className="text-[#EAEAEA] text-xs font-semibold text-right ml-2">{v}</span>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>

        <div className="flex flex-col sm:flex-row items-stretch sm:items-center gap-4 pt-6 border-t border-slate-800">
          <button
            onClick={handleVoiceSummary}
            className="flex items-center justify-center gap-2 px-6 py-4 rounded-xl bg-[#6D5BD0]/10 text-[#6D5BD0] border border-[#6D5BD0]/30 hover:bg-[#6D5BD0]/20 transition-all font-bold text-sm"
          >
            <Volume2 size={18} className={isSpeaking ? "animate-bounce" : ""} />
            {isSpeaking ? "Speaking..." : "Voice Summary"}
          </button>

          <button
            onClick={() => onCommit(result)}
            className="flex-1 bg-[#2F8F9D] hover:bg-[#2F8F9D]/90 text-white px-8 py-4 rounded-xl font-bold transition-all flex items-center justify-center gap-2 shadow-lg shadow-[#2F8F9D]/30"
          >
            <Plus size={20} />
            Commit to Inventory Registry
          </button>

          <button
            onClick={() => {
              setResult(null);
              onNewScan();
            }}
            className="px-6 py-4 text-[#B0B8C1] hover:text-white transition-all font-bold text-sm uppercase tracking-widest"
          >
            NEW SCAN
          </button>
        </div>
      </div>
    );
