import { GoogleGenAI, Modality } from "@google/genai";

/**
 * Utility to wait for a specified duration.
 */
const wait = (ms: number) => new Promise(resolve => setTimeout(resolve, ms));

/**
 * Generates content using the Vision model for OCR.
 */
export const performOCR = async (imageBase64: string): Promise<string> => {
  const ai = new GoogleGenAI({ apiKey: process.env.API_KEY });
  try {
    const response = await ai.models.generateContent({
      model: 'gemini-3-flash-preview',
      contents: [
        {
          parts: [
            { inlineData: { mimeType: 'image/jpeg', data: imageBase64 } },
            { text: "Extract the cylinder serial number from this image. Only return the serial number string, nothing else. Focus on alphanumeric patterns like '354434.S' or '593286.J'." }
          ]
        }
      ]
    });
    return response.text?.trim() || '';
  } catch (error) {
    console.error("OCR Error:", error);
    return "";
  }
};

/**
 * Generates spoken audio (TTS) for the cylinder report.
 * Strictly adheres to guidelines:
 * - Uses Modality.AUDIO
 * - Implements exponential backoff for 429 (Rate Limit) errors.
 */
export const generateVoiceSummary = async (
  text: string, 
  languageName: string, 
  onAudioReady: (audioBuffer: AudioBuffer) => void
): Promise<{ success: boolean; errorType?: 'quota' | 'other' }> => {
  const ai = new GoogleGenAI({ apiKey: process.env.API_KEY });
  const prompt = `Read the following cylinder inspection report aloud in ${languageName}. Pronounce all ID numbers and serial codes clearly digit by digit. Report: ${text}`;

  const maxRetries = 3;
  let delay = 1000;

  for (let attempt = 0; attempt <= maxRetries; attempt++) {
    try {
      const response = await ai.models.generateContent({
        model: "gemini-2.5-flash-preview-tts",
        contents: [{ parts: [{ text: prompt }] }],
        config: {
          responseModalities: [Modality.AUDIO],
          speechConfig: {
            voiceConfig: {
              prebuiltVoiceConfig: { voiceName: 'Kore' },
            },
          },
        },
      });

      const candidate = response.candidates?.[0];
      const base64Audio = candidate?.content?.parts?.find(p => p.inlineData)?.inlineData?.data;

      if (base64Audio) {
        const audioContext = new (window.AudioContext || (window as any).webkitAudioContext)({ sampleRate: 24000 });
        const audioData = decode(base64Audio);
        const buffer = await decodeAudioData(audioData, audioContext, 24000, 1);
        onAudioReady(buffer);
        return { success: true };
      }

      throw new Error("No audio data");
    } catch (error: any) {
      const errorStr = JSON.stringify(error);
      const isQuotaError = errorStr.includes('429') || errorStr.includes('RESOURCE_EXHAUSTED') || errorStr.includes('quota');

      if (isQuotaError && attempt < maxRetries) {
        console.warn(`TTS Quota reached. Retrying in ${delay}ms... (Attempt ${attempt + 1})`);
        await wait(delay);
        delay *= 2; // Exponential backoff
        continue;
      }

      console.error("Voice Summary Error:", error);
      return { 
        success: false, 
        errorType: isQuotaError ? 'quota' : 'other' 
      };
    }
  }

  return { success: false, errorType: 'quota' };
};

// Audio Utilities
function decode(base64: string) {
  const cleanedBase64 = base64.replace(/\s/g, '');
  const binaryString = atob(cleanedBase64);
  const len = binaryString.length;
  const bytes = new Uint8Array(len);
  for (let i = 0; i < len; i++) {
    bytes[i] = binaryString.charCodeAt(i);
  }
  return bytes;
}

async function decodeAudioData(
  data: Uint8Array,
  ctx: AudioContext,
  sampleRate: number,
  numChannels: number,
): Promise<AudioBuffer> {
  const dataInt16 = new Int16Array(data.buffer);
  const frameCount = dataInt16.length / numChannels;
  const buffer = ctx.createBuffer(numChannels, frameCount, sampleRate);

  for (let channel = 0; channel < numChannels; channel++) {
    const channelData = buffer.getChannelData(channel);
    for (let i = 0; i < frameCount; i++) {
      channelData[i] = dataInt16[i * numChannels + channel] / 32768.0;
    }
  }
  return buffer;
}

import React, { useState, useRef, useEffect } from 'react';
import { Camera, Upload, Volume2, Plus, RefreshCcw, Box, Activity, Calendar, Eye, AlertCircle } from 'lucide-react';
import { CylinderRecord, LANGUAGES } from '../types';
import { performOCR, generateVoiceSummary } from '../services/geminiService';
import { matchSerialFromOCR } from '../services/dataService';

interface ScannerProps {
  onCommit: (record: CylinderRecord) => void;
  onNewScan: () => void;
}

const Scanner: React.FC<ScannerProps> = ({ onCommit, onNewScan }) => {
  const [isScanning, setIsScanning] = useState(false);
  const [isLoading, setIsLoading] = useState(false);
  const [result, setResult] = useState<CylinderRecord | null>(null);
  const [selectedLang, setSelectedLang] = useState('en');
  const [voiceStatus, setVoiceStatus] = useState<'idle' | 'loading' | 'speaking' | 'quota_error' | 'error'>('idle');

  const videoRef = useRef<HTMLVideoElement>(null);
  const canvasRef = useRef<HTMLCanvasElement>(null);
  const audioSourceRef = useRef<AudioBufferSourceNode | null>(null);

  const startCamera = async () => {
    try {
      setIsScanning(true);
      const stream = await navigator.mediaDevices.getUserMedia({ video: { facingMode: 'environment' } });
      if (videoRef.current) {
        videoRef.current.srcObject = stream;
      }
    } catch (err) {
      console.error("Camera error:", err);
      setIsScanning(false);
    }
  };

  const captureAndOCR = async () => {
    if (!videoRef.current || !canvasRef.current) return;

    setIsLoading(true);
    const context = canvasRef.current.getContext('2d');
    canvasRef.current.width = videoRef.current.videoWidth;
    canvasRef.current.height = videoRef.current.videoHeight;
    context?.drawImage(videoRef.current, 0, 0);

    const base64 = canvasRef.current.toDataURL('image/jpeg').split(',')[1];

    // Stop camera
    const stream = videoRef.current.srcObject as MediaStream;
    stream.getTracks().forEach(t => t.stop());
    setIsScanning(false);

    const ocrResult = await performOCR(base64);
    const matchedRecord = matchSerialFromOCR(ocrResult);

    setResult(matchedRecord);
    setIsLoading(false);
  };

  const handleFileUpload = async (e: React.ChangeEvent<HTMLInputElement>) => {
    const file = e.target.files?.[0];
    if (!file) return;

    setIsLoading(true);
    const reader = new FileReader();
    reader.onload = async (event) => {
      const base64 = (event.target?.result as string).split(',')[1];
      const ocrResult = await performOCR(base64);
      const matchedRecord = matchSerialFromOCR(ocrResult);
      setResult(matchedRecord);
      setIsLoading(false);
    };
    reader.readAsDataURL(file);
  };

  const handleVoiceSummary = async () => {
    if (!result) return;

    if (audioSourceRef.current) {
      try { audioSourceRef.current.stop(); } catch (e) {}
    }

    setVoiceStatus('loading');
    const langObj = LANGUAGES.find(l => l.code === selectedLang);
    const textToRead = `
      Cylinder identification: ${result.cylinderId}.
      Serial number: ${result.serialNumber}.
      Manufacturer: ${result.manufacturer}.
      Capacity: ${result.capacity}.
      Working pressure: ${result.workingPressure}.
      Standard code: ${result.standardCode}.
      Test date: ${result.testDate}.
      Inspection status: ${result.remarks}.
    `;

    const response = await generateVoiceSummary(textToRead, langObj?.name || 'English', (buffer) => {
      const ctx = new (window.AudioContext || (window as any).webkitAudioContext)();
      if (ctx.state === 'suspended') ctx.resume();

      const source = ctx.createBufferSource();
      source.buffer = buffer;
      source.connect(ctx.destination);
      source.onended = () => setVoiceStatus('idle');
      source.start(0);
      audioSourceRef.current = source;
      setVoiceStatus('speaking');
    });

    if (!response.success) {
      setVoiceStatus(response.errorType === 'quota' ? 'quota_error' : 'error');
    }
  };

  useEffect(() => {
    if (result) {
      handleVoiceSummary();
    }
    return () => {
      if (audioSourceRef.current) {
        try { audioSourceRef.current.stop(); } catch (e) {}
      }
    };
  }, [result, selectedLang]);

  if (isLoading) {
    return (
      <div className="flex flex-col items-center justify-center h-[70vh] space-y-4 px-6 text-center animate-pulse">
        <RefreshCcw className="w-12 h-12 text-[#2F8F9D] animate-spin" />
        <p className="text-xl font-medium text-[#EAEAEA]">Analyzing Cylinder...</p>
        <p className="text-[#B0B8C1] text-sm font-medium tracking-wide">Performing Global Registry Matching</p>
      </div>
    );
  }

  if (result) {
    return (
      <div className="p-4 lg:p-8 max-w-5xl mx-auto space-y-6 animate-in slide-in-from-bottom duration-500">
        <div className="flex flex-col sm:flex-row justify-between items-start sm:items-center gap-4 mb-4">
          <div className="space-y-1">
            <h1 className="text-3xl lg:text-4xl font-bold break-all text-[#EAEAEA]">{result.serialNumber}</h1>
            <div className="flex flex-wrap gap-2">
